import Login from "./pages/Login";


import { BrowserRouter, Routes, Route } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="./pages/Home"/>
          <Route path="./pages/Login"/>
          <Route path="./pages/Login"/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
